package cn.com.evo.integration.common.result;/** * @Description: * @author: lu.xin * @create: 2019-03-18 1:43 PM **/public class PayResult {    private String orderId;    private String qrcodeUrl;    private String qrcode;    private String retCode;    private String retMsg;    public PayResult(String orderId, String qrcodeUrl, String qrcode) {        this.orderId = orderId;        this.qrcodeUrl = qrcodeUrl;        this.qrcode = qrcode;    }    public PayResult(String qrcodeUrl, String qrcode, String retCode, String retMsg) {        this.qrcodeUrl = qrcodeUrl;        this.qrcode = qrcode;        this.retCode = retCode;        this.retMsg = retMsg;    }    public String getOrderId() {        return orderId;    }    public void setOrderId(String orderId) {        this.orderId = orderId;    }    public String getQrcodeUrl() {        return qrcodeUrl;    }    public void setQrcodeUrl(String qrcodeUrl) {        this.qrcodeUrl = qrcodeUrl;    }    public String getQrcode() {        return qrcode;    }    public void setQrcode(String qrcode) {        this.qrcode = qrcode;    }    public String getRetCode() {        return retCode;    }    public void setRetCode(String retCode) {        this.retCode = retCode;    }    public String getRetMsg() {        return retMsg;    }    public void setRetMsg(String retMsg) {        this.retMsg = retMsg;    }}